import React from 'react'
import styles from '../styles/tabel.module.scss'

export const Table = ({ header, body }) => {
    return (
        <table className={styles.table}>
            <thead>
                <tr className={styles.tr}>
                    {
                        header ? header.map((item, index) => {
                            return (<th key={index} className={styles.th}>{item}</th>)
                        }) : null
                    }
                </tr>
            </thead>
            <tbody>
                {
                    body ? body.map((item, index) => {
                        return (
                            <tr key={item} className={styles.tr}>
                                <td className={styles.td}>Yes</td>
                                <td className={styles.td}>Free</td>
                                <td className={styles.td}>Web Development and Design</td>
                            </tr>
                        )
                    }) : null
                }

            </tbody>
        </table >
    )
}
